// import react from "react";
import GlobleContext from "./GlobleContext";

const GlobleState = (props) => {
  const state = {
    name: "om",
    class: "MCA",
  };

  return (
    <GlobleContext.Provider value={state}>
      {props.children}
    </GlobleContext.Provider>
  );
};

export default GlobleState;
